chrome.commands.onCommand.addListener(function (command) {
    (pages || []).forEach(page => {
        page.postMessage({method: command, args: []});
    });
});

let connections = 0;
let host = null;
let pages = [];

chrome.runtime.onConnect.addListener(function (page) {
    if (!connections++)
        host = chrome.runtime.connectNative('org.mpris.browser_host.debug');

    pages.push(page);
    function passMessage (msg) {
        if (msg.tabId === page.sender.tab.id || msg.tabId < 0) {
            switch (msg.method) {
                case 'Raise':
                    raiseTab(msg.tabId);
                    break;
                case 'Quit':
                    removeTab(msg.tabId);
                    break;
                default:
                    page.postMessage(msg);
            }
        }
    }

    host.onMessage.addListener(passMessage);

    page.onMessage.addListener(function (msg) {
        msg.tabId = page.sender.tab.id;
        host.postMessage(msg);
    });
    page.onDisconnect.addListener(function () {
        host.postMessage({ type: 'quit', tabId: page.sender.tab.id });
        host.onMessage.removeListener(passMessage);
        if (!--connections)
            host.disconnect();
    });
});

function raiseTab (tabId) {
    // first activate the tab, this means it's current in its window
    chrome.tabs.update(tabId, { active: true }, function (tab) {
        if (chrome.runtime.lastError || !tab) {
            // this "lastError" stuff feels so archaic
            // failed to update
            return;
        }
        // then raise the tab's window too
        chrome.windows.update(tab.windowId, { focused: true });
    });
}

function removeTab (tabId) {
    chrome.tabs.remove(tabId);
}

chrome.runtime.onStartup.addListener(() => {
    fetch('https://api.github.com/repos/lt-mayonesa/browser-mpris2/releases/latest')
      .then(response => response.json())
      .then(json => {
          return {
              title: json.name, version: json.tag_name, artifact: json.assets[0].browser_download_url
          };
      })
      .then(data => {
          let current = chrome.runtime.getManifest().version
            .replace('v', '')
            .replace(/\./g, '');
          let latest = data.version.replace('v', '')
            .replace(/\./g, '');
          if (Number(latest) > Number(current)) {
              chrome.browserAction.setBadgeText({
                  text: 'new'
              });
              chrome.browserAction.setBadgeBackgroundColor({
                  color: '#F00'
              });
          }
      })
      .catch(console.error);
});

hackAudioTags();

// If this project grows we should consider dependency injection
/**
 * The instance of {@link Playback} for this web site.
 * We define it here so it can be accessed by any provider specific code.
 * @const {Playback}
 */
const playback = new Playback();

/**
 * The instance of {@link Carrier} for this web site.
 * There should be no need to interact directly with it.
 * @const {Carrier}
 */
const carrier = new Carrier();

/**
 * The instance of {@link Host} for this web site.
 * There should be no need to interact directly with it.
 * @const {Host}
 */
const host = new Host(playback, carrier, chrome.runtime.connect());

/**
 * The instance of {@link Page} for this web site.
 * We define it here so it can be accessed by any provider specific code.
 * @const {Page}
 */
const page = new Page(document, playback, host);

window.addEventListener('load', () => {

    page.checkForMediaElements();

    page.observeForMedia(document.documentElement);

    setTimeout(() => {
        page.checkForMediaElements();
    }, 1000);

    window.dispatchEvent(new Event('mpris2-setup'));
});

window.addEventListener('DOMContentLoaded', () => {
    page.checkForMediaElements();
});

/**
 * Here we replace the <b>document.createElement</b> function with our own so we can detect
 * when an &lt;audio&gt; tag is created that is not added to the DOM which most pages do
 * while a &lt;video&gt; tag typically ends up being displayed to the user, audio is not.
 *
 * Original code from {@link https://github.com/KDE/plasma-browser-integration/blob/master/extension/content-script.js}
 * @ignore
 */
function hackAudioTags () {
    // Bug 379087: Only inject this stuff if we're a proper HTML page
    // otherwise we might end up messing up XML stuff
    // only if our documentElement is a "html" tag we'll do it
    // the rest is only set up in DOMContentLoaded which is only executed for proper pages anyway

    // tagName always returned "HTML" for me but I wouldn't trust it always being uppercase
    if (document.documentElement.tagName.toLowerCase() === 'html') {
        // HACK We cannot really pass variables from the page's scope to our content-script's scope
        // so we just blatantly insert the <audio> tag in the DOM and pick it up through our regular
        // mechanism. Let's see how this goes :D

        executeScript(`function() {
                var oldCreateElement = document.createElement;
                document.createElement = function () {
                    var createdTag = oldCreateElement.apply(this, arguments);
                    var tagName = arguments[0];
                    if (typeof tagName === "string" && tagName.toLowerCase() === "audio") {
                        (document.head || document.documentElement).appendChild(createdTag);
                    }
                    return createdTag;
                };
            }
        `);

        // We also briefly add items created as new Audio() to the DOM so we can control it
        // similar to the document.createElement hack above
        executeScript(`function() {
                var oldAudio = window.Audio;
                window.Audio = function () {
                    var createdAudio = new (Function.prototype.bind.apply(oldAudio, arguments));
                    (document.head || document.documentElement).appendChild(createdAudio);
                    createdAudio.parentNode.removeChild(createdAudio);
                    return createdAudio;
                };
            }
        `);
    }
}

/**
 * Execute a script on the current context and then remove it
 *
 * @ignore
 * @param {string} script
 */
function executeScript (script) {
    let element = document.createElement('script');
    element.innerHTML = '(' + script + ')();';
    (document.body || document.head || document.documentElement).appendChild(element);
    // We need to remove the script tag after inserting or else websites relying on the order of items in
    // document.getElementsByTagName("script") will break (looking at you, Google Hangouts)
    element.parentNode.removeChild(element);
}

/**
 * A class in charge of building the payload expected by the native app
 * the payload must be a {@link Payload}
 */
class Carrier {
    /**
     * Generate a new {@link Carrier}
     */
    constructor () {
        /**
         *
         * @type {Payload}
         */
        this.last = {};
    }

    /**
     * Clear the last payload sent
     */
    clear () {
        this.last = {};
    }

    /**
     * Store the last payload sent
     * @param {Payload} payload
     */
    store (payload) {
        this.last = payload;
    }

    /**
     *
     * @param {Playback} playback
     * @returns {Payload}
     */
    payloadFrom (playback) {
        return {
            PlaybackStatus: playback.getStatus(),
            LoopStatus: playback.getLoopStatus(),
            Shuffle: playback.isShuffle(),
            Volume: playback.getVolume(),
            CanGoNext: playback.canGoNext(),
            CanGoPrevious: playback.canGoPrevious(),
            Identity: playback.getIdentity(),
            Rate: playback.getRate(),
            Metadata: {
                'mpris:trackid': playback.activePlayer.getId(),
                'mpris:length': playback.activePlayer.getLength(),
                'mpris:artUrl': playback.activePlayer.getCover(),
                'xesam:url': playback.activePlayer.getUrl(),
                'xesam:title': playback.activePlayer.getTitle(),
                'xesam:artist': playback.activePlayer.getArtists(),
            }
        };
    }

    /**
     *
     * @param {Payload} payload
     * @return {Payload}
     */
    onlyUpdated (payload) {
        let diffs = {
            Metadata: {}
        };
        for (let prop in payload) {
            if (prop === 'Metadata') {
                let changed = false;
                for (let meta in payload.Metadata) {
                    if (JSON.stringify(payload.Metadata[meta]) !== (this.last.Metadata && JSON.stringify(this.last.Metadata[meta]))) {
                        changed = true;
                    }
                }
                if (changed)
                    diffs.Metadata = payload.Metadata;
            } else if (payload[prop] !== this.last[prop])
                diffs[prop] = payload[prop];
        }
        if (Object.keys(diffs.Metadata).length === 0)
            delete diffs.Metadata;
        // noinspection JSValidateTypes
        return diffs;
    }

    /**
     *
     * @param {Playback} playback
     * @returns {Payload}
     */
    requestPayload (playback) {
        let payload = this.payloadFrom(playback);
        let diffs = this.onlyUpdated(payload);
        this.store(payload);
        return diffs;
    }
}

/**
 *
 * A class in charge of communicating back and forth with the native app.
 *
 * There should be no need to modify/extend this class
 * as it uses {@link Playback} to build the messages to send
 * and as the receiver of all messages from the MPRIS2 interfase
 *
 */
class Host {
    /**
     *
     * @param {Playback} playback - the playback of the current site
     * @param {Carrier} carrier
     * @param {Object} port - see {@link https://developer.chrome.com/apps/runtime#type-Port}
     */
    constructor (playback, carrier, port) {
        /**
         * The playback to interact with
         * @type {Playback}
         */
        this.playback = playback;
        /**
         * A carrier for caching and building the payloads
         * @type {Carrier}
         */
        this.carrier = carrier;
        /**
         * A chrome.runtime.Port
         * @see https://developer.chrome.com/apps/runtime#type-Port
         * @type {Object}
         */
        this.port = port;

        /**
         * The default Payload.Identity for the MPRIS2 Interface
         * @type {string}
         */
        this.source = 'browser';

        this.port.onMessage.addListener((r, s, sr) => this.messageListener(r));
    }

    /**
     * Send a message to host app
     *
     * @param {MessageType} type
     * @param {Object|number} [payload]
     */
    sendMessage (type, payload) {
        this.port.postMessage({
            source: this.source,
            type: type,
            args: [payload]
        });
    }

    /**
     * Send a change message to host app
     */
    change () {
        if (this.playback.activePlayer) {
            let payload = this.carrier.requestPayload(this.playback);
            if (Object.keys(payload || {}).length)
                this.sendMessage(
                  MessageType.CHANGE,
                  payload
                );
        }
    }

    /**
     * Set player as active player and send data to native app
     *
     * @param {Player} player
     */
    start (player) {
        this.playback.setActivePlayer(player);
        this.change();
    }

    /**
     *
     * @param {MessageMethod} method
     * @param {*} args
     */
    return (method, args) {
        this.port.postMessage({
            source: this.source,
            type: MessageType.RETURN,
            method, args
        });
    }

    /**
     * Send a seeked message to host
     *
     * @param {Player} player
     */
    seeked (player) {
        this.sendMessage(
          MessageType.SEEK,
          player.getPosition()
        );
    }

    /**
     * Send a quit message to host
     */
    quit () {
        this.carrier.clear();
        this.sendMessage(
          MessageType.QUIT
        );
    }

    /**
     * Listener for messages from native application (aka: mpris interface)
     *
     * @param {Object} request
     * @param {MessageMethod} request.method
     * @param {Array}  request.args
     */
    messageListener (request) {
        let result;
        if (request.method === MessageMethod.GET) {
            result = this.get(...request.args);
        } else if (request.method === MessageMethod.SET) {
            result = this.set(...request.args);
        } else {
            result = this.command(request.method, ...request.args);
        }
        this.return(request.method, result);
    }

    /**
     * Native application wants to Get a property from client
     *
     * @param {string} _ - org.mpris.MediaPlayer2.Player
     * @param {MessageProperty} propName - property that should be returned
     * @returns {number|void}
     */
    get (_, propName) {
        if (propName === MessageProperty.POSITION) {
            return this.playback.getPosition() || 0;
        }
    }

    /**
     * Native application wants to Set a property
     * in the client.
     *
     * @param {string} _ - org.mpris.MediaPlayer2.Player
     * @param {MessageProperty} propName - property to set
     * @param {number|LoopStatus|boolean} [newValue] - depends on the property to set
     */
    set (_, propName, newValue) {
        switch (propName) {
            case MessageProperty.RATE:
                this.playback.setRate(Number(newValue));
                break;

            case MessageProperty.VOLUME:
                this.playback.setVolume(Number(newValue));
                break;

            case MessageProperty.SHUFFLE:
                this.playback.setShuffle(Boolean(newValue));
                break;

            case MessageProperty.LOOP_STATUS:
                this.playback.setLoopStatus(Object.values(LoopStatus).find(e => e === newValue));
                break;

            case MessageProperty.FULL_SCREEN:
                this.playback.toggleFullScreen();
                break;
        }
    }

    /**
     * Native application wants to run a command on playback
     *
     * @param {MessageMethod} name
     */
    command (name) {
        switch (name) {
            case MessageMethod.PLAY:
                this.playback.play();
                break;
            case MessageMethod.PAUSE:
                this.playback.pause();
                break;
            case MessageMethod.TOGGLE:
                this.playback.togglePlayback();
                break;
            case MessageMethod.STOP:
                this.playback.stop();
                break;
            case MessageMethod.NEXT:
                this.playback.next();
                break;
            case MessageMethod.PREVIOUS:
                this.playback.previous();
                break;
            case MessageMethod.SEEK:
                this.playback.seek(arguments[1]);
                break;
            case MessageMethod.SET_POSITION: //why is this not in set?
                this.playback.setPosition(arguments[1], arguments[2]);
                break;
        }
    }
}

/**
 * A class in charge of detecting new {@link HTMLMediaElement}s in current page
 * and registering them as players.
 *
 * The expected usage is call {@link checkForMediaElements} and {@link observeForMedia}
 * upon window.load event.
 */
class Page {
    /**
     *
     *
     * @param {Document} document
     * @param {Playback} playback
     * @param {Host} host
     */
    constructor (document, playback, host) {
        /**
         * The current document to keep as context
         * @type {Document}
         */
        this.document = document;

        /**
         * Current {@link Playback} on the page
         * @type {Playback}
         */
        this.playback = playback;

        /**
         * Current {@link Host} to trigger changes
         * @type {Host}
         */
        this.host = host;

        /**
         * An array holding all {@link Player}s present in the page
         *
         * @type {Array.<Player>}
         */
        this.players = [];

        /**
         * Upon load of a page this property can be used by providers
         * to cache html elements that are likely to be used repeatedly.
         *
         * @see src/browser/providers/soundcloud.js - for an example.
         *
         * @type {Object.<string, HTMLElement>}
         */
        this.elements = {};

        /**
         * An observer for added media elements
         * use {@link observeForMedia} to observer elements
         *
         * @type {MutationObserver}
         * @private
         */
        this._mediaObserver = new MutationObserver(m => this.onMutate(m));

        /**
         * An observer to trigger change events on the host
         * use {@link observeForChanges} to add elements
         *
         * @type {MutationObserver}
         * @private
         */
        this._changesObserver = new MutationObserver(() => this.host.change());
    }

    /**
     * Take the element and add it to the list of players
     * if it's not already there
     *
     * Use when detecting a new element on the DOM
     *
     * If the element is playing it will be set as the active player.
     *
     * @param element
     * @return {boolean}
     */
    registerPlayer (element) {
        if (this.players.find(player => player.element === element)) {
            return false;
        }

        let player = new Player(this, this.host, element);

        this.players.push(player);

        // Ignore short sounds, they are most likely a chat notification sound
        // but still allow when undetermined (e.g. video stream)
        if (player.isPlaying()) {
            this.setActivePlayer(player);
        }
        return true;
    }

    /**
     * Set element to be observed by {@link this._mediaObserver}
     *
     * @param {Element} element
     */
    observeForMedia (element) {
        this._mediaObserver.observe(element, {
            childList: true,
            subtree: true
        });
    }

    /**
     * Set element to be observed by {@link this._changesObserver}
     * by default check for any changes to itself or it's children
     *
     * @param {Element} element
     * @param {MutationObserverInit} options
     */
    observeForChanges (element, options = { childList: true, subtree: true }) {
        this._changesObserver.observe(element, options);
    }

    /**
     * Callback called by {@link this._mediaObserver}
     * Given an array of mutations check if there where any added nodes that are media
     *
     * @param {Array<MutationRecord>} mutations
     */
    onMutate (mutations) {
        mutations.forEach(mutation => {
            mutation.addedNodes.forEach(node => {
                if (typeof node.matches !== 'function' || typeof node.querySelectorAll !== 'function') {
                    return;
                }

                // first check whether the node itself is audio/video
                if (node.matches('video,audio')) {
                    this.registerPlayer(node);
                    return;
                }

                // if not, check whether any of its children are
                node.querySelectorAll('video,audio')
                  .forEach(player => this.registerPlayer(player));
            });
        });
    }

    /**
     * Search DOM for any &lt;video&gt; or &lt;audio&gt; elements
     */
    checkForMediaElements () {
        this.document.querySelectorAll('video,audio')
          .forEach(player => this.registerPlayer(player));
    }

    /**
     * Set the playback's active player
     *
     * @param {Player} player
     */
    setActivePlayer (player) {
        this.host.start(player);
    }

    /**
     * Get the playbacks active player
     *
     * @returns {Player}
     */
    getActivePlayer () {
        return this.playback.activePlayer;
    }

    /**
     * Get the page's title
     *
     * @returns {null|string}
     */
    getTitle () {
        return this.document.title;
    }

    /**
     * Get the page's favicon
     *
     * @returns {string}
     */
    getIcon () {
        return this.document
          .querySelector('link[rel="shortcut icon"],link[rel="icon"]')
          .getAttribute('href');
    }

}

/**
 * There should be one instance of Playback per page
 *
 * This class is in charge of handling the playback of the active player
 * it receives the commands from its {@link Host} and communicates the accordingly
 * to the player.
 *
 * It's also the responsible for exposing all the getters necessary
 * to conform the {@link Payload} message.
 *
 * By default all properties of {@link Payload} are extracted from the {@link this.activePlayer}
 * although it is expected that this functionality is overridden by the providers.
 */
class Playback {
    /**
     * Create a new instance
     */
    constructor () {
        /**
         * A dictionary of any controls extracted from the DOM
         * @type {Object.<string, HTMLElement>}
         */
        this.controls = {};

        /**
         * The current player being shown by the MPRIS2 interface
         *
         * @type {Player}
         */
        this.activePlayer = null;
    }

    /**
     * One of {@link PlaybackStatus.PLAYING} or {@link PlaybackStatus.PAUSED}
     * @returns {string}
     */
    getStatus () {
        return this.activePlayer && this.activePlayer.isPlaying() ? PlaybackStatus.PLAYING : PlaybackStatus.PAUSED;
    }

    /**
     * Set the volume of playback
     * @param {number} volume
     */
    setVolume (volume) {
        this.activePlayer && this.activePlayer.setVolume(volume);
    }

    /**
     * Get the volume of playback
     * @returns {null|number}
     */
    getVolume () {
        return this.activePlayer && this.activePlayer.getVolume();
    }

    /**
     * Set the rate of playback.
     * @example
     * playback.setRate(1.5);
     * @param {number} rate
     */
    setRate (rate) {
        this.activePlayer && this.activePlayer.setRate(rate);
    }

    /**
     * Get the rate of playback
     * @returns {null|number}
     */
    getRate () {
        return this.activePlayer && this.activePlayer.getRate();
    }

    /**
     * Set the shuffle between tracks of playback
     * @param {boolean} isShuffle
     */
    setShuffle (isShuffle) {}

    /**
     * Get if the playback is shuffling between tracks
     * @return {boolean}
     */
    isShuffle () {
        return false;
    }

    /**
     * By default we don't support playlist looping ({@link LoopStatus}.PLAYLIST)
     * so we force {@link LoopStatus}.TRACK loop if any loop other than {@link LoopStatus}.NONE is specified
     *
     * @param {LoopStatus} status
     */
    setLoopStatus (status) {
        let loopStatus = status === LoopStatus.PLAYLIST ? LoopStatus.TRACK : status;
        this.activePlayer && this.activePlayer.setLoop(loopStatus === LoopStatus.TRACK);
    }

    /**
     * Get the loop status of playback
     * @returns {LoopStatus}
     */
    getLoopStatus () {
        return this.activePlayer && this.activePlayer.isLooping() ?
          LoopStatus.TRACK : LoopStatus.NONE;
    }

    /**
     * Check current page for 'next' functionality
     *
     * @returns {boolean}
     */
    canGoNext () {
        return false;
    }

    /**
     * Check current page for 'previous' functionality
     *
     * @returns {boolean}
     */
    canGoPrevious () {
        return false;
    }

    /**
     * Go to next media
     * This should be implemented per provider
     */
    next () {}

    /**
     * Go to previous
     * This should be implemented per provider
     */
    previous () {}

    /**
     * **COMMAND** Start to play active player
     */
    play () {
        this.activePlayer && this.activePlayer.play();
    }

    /**
     * **COMMAND** Pause active player
     */
    pause () {
        this.activePlayer && this.activePlayer.pause();
    }

    /**
     * **COMMAND** Toggle between play and pause
     */
    togglePlayback () {
        this.activePlayer && this.activePlayer.playPause();
    }

    /**
     * **COMMAND** Stop active player
     */
    stop () {
        this.activePlayer && this.activePlayer.stop();
    }

    /**
     * **COMMAND** Seek activePlayer to offset
     *
     * @param {number} offset
     */
    seek (offset) {
        this.activePlayer && this.activePlayer.seek(offset);
    }

    /**
     * **COMMAND** Set current position of active player
     *
     * @param {string} id - the id of the player
     * @param {number} position
     */
    setPosition (id, position) {
        this.activePlayer && this.activePlayer.setPosition(position);
    }

    /**
     * **COMMAND** Get active player's position
     *
     * @returns {null|number}
     */
    getPosition () {
        return this.activePlayer !== null ? this.activePlayer.getPosition() : null;
    }

    /**
     * Set the current active player
     *
     * @param {Player} player
     */
    setActivePlayer (player) {
        if (player.isValid()) {
            this.activePlayer = player;
        }
    }

    /**
     * **COMMAND** Toggle the fullscreen state
     *
     * @todo test this works
     */
    toggleFullScreen () {
        this.activePlayer && this.activePlayer.toggleFullScreen();
    }

    /**
     * Get the identity of playback, by default it is the site's domain
     *
     * @returns {null|string}
     */
    getIdentity () {
        return this.activePlayer && this.activePlayer.getSiteDomain();
    }

}

/**
 * A class that wraps around HTMLMediaElement
 *
 * It sends to the {@link Host} all relevant media events (ie: play, pause, etc)
 *
 * This class should be extended in order to give **provider** specific support.
 * By default all getter and setters interact with the media element, this can be overwritten
 * by extending this class so it gets and sets by interacting with the relevant places for each **provider**.
 */
class Player {
    /**
     * Create a new instance of player
     * @param {Page} page
     * @param {Host} host
     * @param {HTMLMediaElement} element
     */
    constructor (page, host, element) {
        /**
         * The {@link Page} that holds the player
         * @type {Page}
         */
        this.page = page;
        /**
         * The {@link Host} to communicate with
         * @type {Host}
         */
        this.host = host;
        /**
         * The media element
         * @type {HTMLMediaElement}
         */
        this.element = element;
        /**
         * A URL with the media baseURI
         * It's updated in {@link refresh} whenever metadata changes
         * @type {Object}
         */
        this.URL = new URL(element.baseURI || '');
        this.initDefaultMediaListeners();
    }

    /**
     * Add listeners on this.element so we propagate all necessary
     * events to the this.host
     */
    initDefaultMediaListeners () {
        this.element.addEventListener('play', () => this.refresh());
        this.element.addEventListener('durationchange', () => this.refresh());
        this.element.addEventListener('loadedmetadata', () => this.refresh());
        this.element.addEventListener('loadstart', () => this.refresh());
    }

    /**
     * Update this.URL so getter read the correct data.
     * Also trigger a {@link this.host.start} event on the {@link Host}.
     */
    refresh () {
        this.URL = new URL(this.element.baseURI || '');
        if (this.isValid()) {
            this.element.addEventListener('pause', () => this.host.change());
            this.element.addEventListener('playing', () => this.host.change());
            this.element.addEventListener('ratechange', () => this.host.change());
            this.element.addEventListener('seeked', () => this.host.seeked(this));
            this.element.addEventListener('volumechange', () => this.host.change());
            this.host.start(this);
        }
    }

    /**
     * Get the id of the player
     * @returns {null|string} the elements source
     */
    getId () {
        return this.element.baseURI;
    }

    /**
     * Returns true if the media is not paused
     *
     * @returns {boolean}
     */
    isPlaying () {
        return !this.element.paused;
    }

    /**
     * Returns true if the media is paused.
     *
     * @return {boolean}
     */
    isPaused () {
        return this.element.paused && this.element.currentTime > 0;
    }

    /**
     * Return true if the media is paused and current time is 0.
     *
     * @return {boolean}
     */
    isStopped () {
        return this.element.paused && this.element.currentTime === 0;
    }

    /**
     * Length is expected in microseconds by host
     *
     * @returns {number}
     */
    getLength () {
        return Math.trunc(this.element.duration * 1e6);
    }

    /**
     * Set the volume of the media
     * @param {number} volume
     */
    setVolume (volume) {
        this.element.volume = volume;
    }

    /**
     * If media is muted return 0
     *
     * @returns {number}
     */
    getVolume () {
        return this.element.muted ? 0.0 : this.element.volume;
    }

    /**
     * Is the media muted?
     *
     * @return {boolean}
     */
    isMuted () {
        return this.element.muted;
    }

    /**
     * Set the playback rate
     * @param {number} rate
     */
    setRate (rate) {
        this.element.playbackRate = rate;
    }

    /**
     * Get the playback rate
     * @returns {number}
     */
    getRate () {
        return this.element.playbackRate;
    }

    /**
     * Get the title of the player. The page's title by default.
     *
     * @returns {null|string}
     */
    getTitle () {
        return this.page.getTitle();
    }

    /**
     * Get the artists of the player
     *
     * @returns {Array<string>}
     */
    getArtists () {
        return [this.URL.host];
    }

    /**
     * Get the cover of the player.
     *
     * Using logo.clearbit.com API seems to work quite nicely.
     * The other alternative is to get the logo from the page's favicon ({@link this.page.getIcon()})
     *
     * @returns {string}
     */
    getCover () {
        return `http://logo.clearbit.com/${this.URL.host}`;
    }

    /**
     * Get the current time of the media
     *
     * @returns {number} media current time
     */
    getPosition () {
        return Math.trunc(this.element.currentTime * 1e6);
    }

    /**
     * Is the media looping?
     * @returns {boolean}
     */
    isLooping () {
        return this.element.loop;
    }

    /**
     * Should media loop when it reaches the end.
     *
     * @param {boolean} loop
     */
    setLoop (loop) {
        this.element.loop = loop;
    }

    /**
     * Play media element
     */
    play () {
        return this.element.play();
    }

    /**
     * Pause media element
     */
    pause () {
        this.element.pause();
    }

    /**
     * If media is playing then pause
     * else play it
     */
    playPause () {
        if (this.isPlaying())
            this.pause();
        else
            this.play();
    }

    /**
     * Pause media and set position to 0
     */
    stop () {
        this.pause();
        this.setPosition(0);
    }

    /**
     * seek by an offset to position
     *
     * @param {number} offset - offset to currentTime in microseconds
     */
    seek (offset) {
        this.element.currentTime += offset / 1e6;
    }

    /**
     * Set the position of playback
     * @param {number} position - new currentTime in microseconds
     */
    setPosition (position) {
        this.element.currentTime = position / 1e6;
    }

    /**
     * Toogle the fullscreen state of the media.
     * @todo test this works
     */
    toggleFullScreen () {
        if (this.element.mozRequestFullScreen) {
            this.element.mozRequestFullScreen();
        } else if (this.element.webkitRequestFullScreen) {
            this.element.webkitRequestFullScreen();
        }
    }

    /**
     * Get the site domain (host)
     * @returns {string}
     */
    getSiteDomain () {
        return this.URL.host;
    }

    /**
     * Get the elements url
     * @returns {null|string}
     */
    getUrl () {
        return this.element.baseURI;
    }

    /**
     * Check if element is visible to the user
     *
     * @returns {boolean}
     */
    isHidden () {
        return this.element.offsetParent === null;
    }

    /**
     *
     * @return {boolean}
     */
    isValid () {
        return !isNaN(this.element.duration) && this.element.duration > 5;
    }
}

